try {
    return org.eclipse.jgit.lib.Repository.getRefDatabase().peel(org.eclipse.jgit.lib.Ref);
} catch (java.io.IOException e) {
    return org.eclipse.jgit.lib.Ref;
}

try {
    java.io.OutputStreamWriter.write("object ");
    org.eclipse.jgit.lib.TagBuilder.getObjectId().copyTo(java.io.OutputStreamWriter);
    java.io.OutputStreamWriter.write('\n');
    java.io.OutputStreamWriter.write("type ");
    java.io.OutputStreamWriter.write(org.eclipse.jgit.lib.Constants.typeString(org.eclipse.jgit.lib.TagBuilder.getObjectType()));
    java.io.OutputStreamWriter.write("\n");
    java.io.OutputStreamWriter.write("tag ");
    java.io.OutputStreamWriter.write(org.eclipse.jgit.lib.TagBuilder.getTag());
    java.io.OutputStreamWriter.write("\n");
    if (org.eclipse.jgit.lib.TagBuilder.(getTagger()) != null) {
        java.io.OutputStreamWriter.write("tagger ");
        java.io.OutputStreamWriter.write(org.eclipse.jgit.lib.TagBuilder.getTagger().toExternalString());
        java.io.OutputStreamWriter.write('\n');
    } 
    java.io.OutputStreamWriter.write('\n');
    if (org.eclipse.jgit.lib.TagBuilder.(getMessage()) != null)
        java.io.OutputStreamWriter.write(org.eclipse.jgit.lib.TagBuilder.getMessage());

    java.io.OutputStreamWriter.close();
} catch (java.io.IOException err) {
    throw new java.lang.RuntimeException(java.io.IOException);
}
